import React from "react";
import {useState} from 'react';
import '../css/footer.css';
import {FacebookBlack} from "../assets/icons/facebook.tsx";
import InstagramIcon from "../assets/icons/instagram.tsx";
import TiktokIcon from "../assets/icons/tiktok.tsx";
import PhoneIcon from "../assets/icons/phone-icon.tsx";
import EmailIcon from "../assets/icons/email-icon.tsx";

export function Footer(){

        const [isHovered, setIsHovered] = useState({
            facebook: false,
            instagram: false,
            tiktok: false,
        });

        const handleMouseEnter = (icon) => {
            setIsHovered((prev) => ({...prev, [icon]:true}));
        };

        const handleMouseLeave = (icon) => {
            setIsHovered((prev) => ({...prev, [icon]:false}));
        };

    return(
        <footer className="footer_wrapp">
            <div className="footer_social">
                <h3>Social</h3>
                <div className="social_wrapp">
                    <span className="facebook_thumb" onMouseEnter={handleMouseEnter('facebook')} onMouseLeave={handleMouseLeave('facebook')}>
                        {isHovered.facebook ? (<FacebookBlack color={"black"} size={45}/>):(<FacebookBlack color={"#556b2f"} size={45}/>)}
                    </span>
                    <span className="instagram_thumb" onMouseEnter={handleMouseEnter} onMouseLeave={handleMouseLeave}>
                        {isHovered ? (<InstagramIcon color={"black"} size={45} />):(<InstagramIcon color={"#556b2f"} size={45} />)}
                    </span>
                    <span className="tiktok_thumb">
                        <TiktokIcon color={"black"} size={45} />
                    </span>
                </div>
            </div>
            <div className="footer_contact">
                <div className="phone">
                    <span className="contact_phone"><PhoneIcon color={"black"} size={30}/></span><strong>317-4048898</strong>
                </div>
                <div className="mail">
                    <span className="contact_email"><EmailIcon color={"black"} size={30}/></span><strong>coffeeshop@contact.com</strong>
                </div>
            </div>
            <div className="footer_copy">
                <p>Copyright 2020</p>
            </div>
        </footer>
    )
};
